import br.com.sankhya.extensions.actionbutton.AcaoRotinaJava;
import br.com.sankhya.extensions.actionbutton.ContextoAcao;
import br.com.sankhya.jape.util.JapeSessionContext;
import br.com.sankhya.modelcore.auth.AuthenticationInfo;
import br.com.sankhya.modelcore.helper.AnexoSistemaHelper;
import br.com.sankhya.ws.ServiceContext;

import java.io.ByteArrayInputStream;
import java.util.HashMap;
import java.util.Map;

import org.cuckoo.core.ScheduledAction;
import org.cuckoo.core.ScheduledActionContext;

import java.io.InputStream;
import java.math.BigDecimal;

public class Base64toAttachAction implements AcaoRotinaJava, ScheduledAction  {


	@Override
	public void doAction(ContextoAcao arg0) throws Exception {
		// TODO Auto-generated method stub
		this.SalvarAnexo(arg0);
	}

	@Override
	public void onTime(ScheduledActionContext arg0) {
		// TODO Auto-generated method stub
		try {
			AuthenticationInfo authenticationInfo = new AuthenticationInfo("SUP", BigDecimal.ZERO, BigDecimal.ZERO, 0);
		    authenticationInfo.makeCurrent();
		    AuthenticationInfo authInfo = AuthenticationInfo.getCurrent();
		    JapeSessionContext.putProperty("usuario_logado", authInfo.getUserID());
		    
			this.SalvarAnexo(null);
		} catch (Exception e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
	}
	
	public void SalvarAnexo(ContextoAcao contexto) throws Exception {
		
		
		Map<String, Object> dadosAnexo = new HashMap<String, Object>();
		dadosAnexo.put("nameEntity", "Parceiro"); // Nome da instância à qual pertence o anexo.
		dadosAnexo.put("pkEntity", AnexoSistemaHelper.buildPkEntity("Parceiro", new Object[] { 1407844 })); // Aqui vai o PK da sua instância. Se a instância tiver chave composta, cada elemento da chave deverá ser passada como um item do array na sequencia correta do banco!
		//dadosAnexo.put("keySession", ""); // Não vamos colocar o keySession porque não vamos usar o arquivo da sessão
		//dadosAnexo.put("resourceID", ""); // Não sei qual a finalidade desse campo, porém ele não é passado na requisição original do Sankye, por isso não vamos passar aqui também
		dadosAnexo.put("description", "Teste de Anexo"); // Descrição do anexo. É opcional
		dadosAnexo.put("typeAcess", "ALL"); // Tipo de acesso. Não sei quais os valores podem ser passados aqui, mas deixei o padrão do anexo nativo do Sankhya
		dadosAnexo.put("typeApres", "GLO"); // Tipo de apresentação. Não sei quais os valores podem ser passados aqui, mas deixei o padrão do anexo nativo do Sankhya
		dadosAnexo.put("nuAttach", null); // Número do anexo. Não passe nada para criar um novo anexo, ou passe o número do anexo para atualizar
		dadosAnexo.put("nameAttach", "Teste Anexo Comprovante.jpg"); // Nome do arquivo
		dadosAnexo.put("oldFile", ""); // Não sei dizer o que isso faz, mas na criação de um novo anexo, ele é passado vazio na chamada nativa do Sankhya
		dadosAnexo.put("fileSelect", new BigDecimal(1)); // Esse campo é pra informar quantos arquivos foram selecionados na tela de anexo. Deixei o padrão 1 pois não verifiquei o impacto disso internamente. Além disso, vamos lidar somente com 1 arquivo por vez.
		dadosAnexo.put("keyAttach", ""); // Não sei dizer o que isso faz, mas na criação de um novo anexo, ele é passado vazio na chamada nativa do Sankhya
		//dadosAnexo.put("link", ""); // Não sei qual a finalidade desse campo, porém ele não é passado na requisição original do Sankye, por isso não vamos passar aqui também
		AnexoSistemaHelper anexoHelper = new AnexoSistemaHelper(dadosAnexo);
		
		String base64Image = "";
		byte[] imageBuffer = com.sankhya.util.Base64Impl.decode(base64Image);		
		InputStream inputStream = new ByteArrayInputStream(imageBuffer);
		anexoHelper.salvarAnexo(inputStream);
		
		if(contexto != null)
			contexto.setMensagemRetorno("Foi gerado o anexo com nuAnexo: " + anexoHelper.getNumeroAnexo().toString());
		
	}

}
